import React from 'react';
import {
  BrowserRouter,
  Route,
  Switch,
} from 'react-router-dom';
import Homepage from './pages/Homepage';

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path='/:lang' component={Homepage} />

      </Switch>
    </BrowserRouter>
  );
}

export default App;
